import React, { Component } from 'react';
import './style/jobList.css';



const JobList = () => {

    const list = ["tarjeta1", "tarjeta2", "tarjeta3", "tarjeta4"];

    return(
        <div>
            <div className="row">
                {
                    list.map(job => {
                        return (
                            <div className="listCard">
                                {job}
                            </div>
                        )
                    })
                }
            </div>
        </div>

    )

}

export default JobList;
